import React,{useState,useEffect} from "react";

const App =() => {

  let timeStr="";

  const[searchValue,setSearchValue]=useState("Pune");

  const[weatherInfo,setWeatherInfo]=useState({});

  const getWeatherInfo = async () => {
    try {

      let url=`https://api.openweathermap.org/data/2.5/weather?q=${searchValue}&units=metric&appid=882175da53303221e2bb734ced2a9472`;

      const res=await fetch(url);
      const data=await res.json();
      console.log(data);

      const{temp,pressure,humidity}=data.main;
      // console.log(temp);
      // console.log(pressure);
      // console.log(humidity);
      const{speed}=data.wind;
      // console.log(speed);
      const{country,sunset}=data.sys;
      // console.log(country);
      // console.log(toLocaleDateString(sunset));
      const{main:weathermood}=data.weather[0];
      // console.log(weathermood);
      const{name}=data;
      // console.log(name);

      let sec=sunset;
      let date=new Date(sec*1000);
      timeStr=`${date.getHours()}:${date.getMinutes()}`;
      console.log(timeStr);

      const infoObject={temp,pressure,humidity,speed,country,timeStr,weathermood,name};


      setWeatherInfo(infoObject);


    } catch (error) {
      console.log(error);
    }
  }

  useEffect(()=>{
    getWeatherInfo();
  },[]);


  return (
    <>

      <div className="searchBar">
        <input className="searchSpace" placeholder="Search By City" value={searchValue} onChange={(e)=>setSearchValue(e.target.value)}></input>
        <button className="searchButton" onClick={getWeatherInfo}>Search</button>
      </div>

      <div className="main-container">
        <div className="container-top">
        <i className="container-top-icon bi bi-brightness-high-fill"></i>
        </div>

        <div className="container-middle">
            <div className="container-left">
              <div className="temperature">{weatherInfo.temp}&deg;C</div>
              <div className="weather">
                <p className="wtype">{weatherInfo.weathermood}</p>
                <p className="city">{weatherInfo.name},{weatherInfo.country}</p>
              </div>
            </div>

            <div className="container-right">
              <p className="date">{new Date().toLocaleDateString()}</p>
              <p className="time">{new Date().toLocaleTimeString()}</p>
            </div>
        </div>

        <div className="container-bottom">
          <div className="info">
            <span className="icon">
              <i className="bi bi-sunset"></i>
            </span>
            <div>
              <p className="ptext1">{weatherInfo.timeStr}</p>
              <p className="ptext1">Sunset</p>
            </div>
          </div>

          <div className="info">
            <span className="icon">
              <i className="bi bi-droplet"></i>
            </span>
            <div>
              <p className="ptext1">{weatherInfo.humidity}</p>
              <p className="ptext1">Humidity</p>
            </div>
          </div>

          <div className="info">
            <span className="icon">
              <i className="bi bi-cloud-drizzle"></i>
            </span>
            <div>
              <p className="ptext1">Pressure</p>
              <p className="ptext1">{weatherInfo.pressure}</p>
            </div>
          </div>

          <div className="info">
            <span className="icon">
              <i className="bi bi-wind"></i>
            </span>
            <div>
              <p className="ptext1">Wind</p>
              <p className="ptext1">{weatherInfo.speed}</p>
            </div>
          </div>
        </div>
      </div>
    </>
  )
};

export default App;
